export default [
  {
    title: "Insat Clubs",
    items: [
      {
        image: img_acm,
        name: "ACM",
        route: "/sections/page-sections/page-headers",
      },
      {
        image: img_ieee,
        name: "IEEE",
        route: "/sections/page-sections/features",
